import useSWR from 'swr';
import Layout from '../components/Layout'

function fetcher(url) {
  return fetch(url).then(r => r.json());
}

export default function Index() {
  const getNewGame = () => {
    const { data, error } = useSWR(`/api/newGame`, fetcher);
    console.log('data: ', data);
    return data;
  }
  return (
    <Layout>
      <main className="center">
        <button className="btn btn-blue" onClick={() => {
          const data = getNewGame();
          console.log('data after click: ', data)
        }}>
          New Game
        </button>
        <div className="center">HomePage What</div>
        {/* {boardMap && <span className="author">- {boardMap}</span>} */}

        <style jsx global>{`
            @font-face {
              font-family: 'Open Sans', sans-serif;
              src: url('https://fonts.googleapis.com/css?family=Open+Sans&display=swap');
              font-weight: bold;
              font-style: normal;
              font-display: swap;
            }`

        }
        </style>
      </main>
    </Layout>
  );
}
